/*
@author: Eligijus Skersonas
*/

import React, { Component } from "react";

class Features extends Component {
  state = {
    count: 0,
    yearBuilt: 1969,
    taxAmount: 4542.86,
    noOfBathrooms: 2,
    noOfBedrooms: 3,
    area: 1476,
  };

  centreContent = {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  };

  render() {
    return (
      <React.Fragment className="bg-primary">
        {this.renderForm()}
      </React.Fragment>
    );
  }

  renderForm() {
    const inputClass = "form-control rounded-pill";
    const submitClass = "form-control rounded-pill";
    const submitStyle = { text: "white", background: "blue" };

    return (
      <div class="row m-4">
        <div class="col">
          <input
            type="text"
            class={inputClass}
            placeholder="Number of Bedrooms"
            aria-label="Number of Bedrooms"
          />
        </div>
        <div class="col">
          <input
            type="text"
            class={inputClass}
            placeholder="Number of Bathrooms"
            aria-label="Number of Bathrooms"
          />
        </div>
        <div class="col">
          <input
            type="text"
            class={inputClass}
            placeholder="Tax Amount"
            aria-label="Tax Amount"
          />
        </div>
        <div class="col">
          <input
            type="text"
            class={inputClass}
            placeholder="Year Built"
            aria-label="Year Built"
          />
        </div>
        <div class="col">
          <input
            type="text"
            class={inputClass}
            placeholder="Area"
            aria-label="Area"
          />
        </div>
        <div class="col">
          <input
            type="submit"
            style={submitStyle}
            class={submitClass}
            placeholder="Predict"
            aria-label="Predict"
          />
        </div>
      </div>
    );
  }
}

export default Features;
